-- Migration 024: Add item text data (display names and descriptions)
-- Extracted from FFXI DAT files (ROM/118/106-110, 217/21, 286/73, 301/115)
-- Source: HorizonXI client installation

BEGIN;

-- Create item_text table for display names and descriptions
CREATE TABLE IF NOT EXISTS item_text (
    itemid INTEGER PRIMARY KEY,
    internal_name TEXT,
    log_name TEXT,
    log_name_plural TEXT,
    description TEXT
);

-- Insert item text data

-- Create indexes for efficient lookups
CREATE INDEX IF NOT EXISTS idx_item_text_logname ON item_text(log_name);
CREATE INDEX IF NOT EXISTS idx_item_text_description ON item_text(description) WHERE description IS NOT NULL AND description != '';

COMMIT;

